            <MyHeader />
            <Navigation />
           


<div>
<h4>1.    Q: How can I order</h4>
<p>A: You can order easily using our online platform. When you find a product you need, you can add it to cart, login and go through the ordering process. After the order is ready, you will receive order summary to your email.</p>
</div>
            <Footer/>

